import React from 'react';
import Card from "./components/Card";
import Data from './data.json';


const heading = "Todo App";
const App = () =>{

    let item = Data.map((res)=><Card title ={res.name} desc = {res.desc} /> )
    return(
        <div>
            <h1 className="headingStyle">{heading}</h1>
           
             {item}
        </div>
    )
}

export default App;
